    <title>grid</title>
    <style>
        .container{
            
            padding: 5px;
            width: 100vw;
           height:100px;
            display: grid;
            grid-template-columns: repeat(5,1fr);

        }

            text-align: center;
            border: 2px solid black;
            border-collapse: collapse;
            display: flex;
            align-items: center;
            justify-content: center;
            background-color: rgb(180, 178, 178);
        }
       .container div{
            display: flex;
            align-items: center;
            justify-content: center;
            border: 2px solid black;   
        border-collapse: collapse;     }
       
    </style>
